import React from "react";
import Logo from "../images/logo3.jpg";

const Header = () => {
  return (
    <header className="header">
      <div className="logo logo__header">
        <img src={Logo} alt="логотип" className="logo__image" />
        <ul className="header__links">
          <li><a href="#" className="link">Услуги</a></li>
          <li><a href="#" className="link">Guide</a></li>
          <li><a href="#" className="link">Контакты</a></li>
          <li><a href="#" className="link"></a></li>
        </ul>
      </div>
    </header>
  );
};

export default Header;
